import React, { Component } from 'react';


class Nav extends Component {
    constructor()
    {
        super();
    }
    render()
    {
        return(
            <div className='navbar'>
                <div className='logo'>Events</div>
                <input type='text' className='nav-search' placeholder='Search '/>
            </div>
        );
    }
}
